import axios from "axios";

export const Sign_In = async (user) => {
  return axios.post(`${process.env.REACT_APP_SERVER_URL}/auth/login`, user);
};

export const Sign_Up = async (user) => {
  try {
    return axios.post(
      `${process.env.REACT_APP_SERVER_URL}/auth/registration`,
      user
    );
  } catch (e) {}
};
